import React, {useContext} from 'react';
import {Context} from "../index";
import {Button, Container, Nav, Navbar} from "react-bootstrap";
import {observer} from "mobx-react-lite";

const NavBar = observer(() => {
    const {seller} = useContext(Context)

    const logOut = () => {
        seller.setSeller({})
        seller.setIsAuth(false)
    }

    return (
        <Navbar bg="dark" variant="dark">
            <Container>
                <Nav className="ms-auto">
                    <Button variant={"outline-light"} href="#home" className="ms-2">Добавить продукт</Button>
                    <Button variant={"outline-light"} href="#home" className="ms-2">Аналитика</Button>
                    <Button variant={"outline-light"} href="#home" className="ms-5">Выход</Button>
                </Nav>
            </Container>
        </Navbar>
    );
});

export default NavBar;
